import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/creators">
            <a style={linkStyle}>Creators</a>
        </Link>
    </div>
);

export default Header;
